import AppLayout from "../components/AppLayout";
import Head from 'next/head';

const signIn = () => {
    return (
        <>
            <Head>
                <meta charset="utf-8"/>
                <title>MiniProject - Sign In</title>
            </Head>
            <AppLayout>
                <div>signIn!</div>
            </AppLayout>
        </>
    );
}

export default signIn;
